// SPDX-License-Identifier: UNLICENSED

pragma solidity 0.8.10;

contract PihiLottery {
    address payable[] public players;
    address public admin;

    constructor() {
        admin = msg.sender;
    }

    // receive 2 ether from each player
    receive() external payable {
        uint256 eth = msg.value;
        require(eth > 0 ether, "Please send some ether");
        require(eth % 2 == 0 ether, "You need to send even number of ether");

        for (uint256 index = 0; index < eth; index += 2) {
            players.push(payable(msg.sender));
        }
    }

    function balance() public view returns (uint256) {
        return address(this).balance;
    }

    function play() public {
        uint256 numberOfPlayers = players.length;
        require(numberOfPlayers >= 3, "Few more tickets to be sold");
        uint256 winnerLocation = pickRandom() % players.length;

        address payable winner = players[winnerLocation];
        winner.transfer(balance());

        players = new address payable[](0);
    }

    function pickRandom() public view returns (uint256) {
        return
            uint256(
                keccak256(
                    abi.encodePacked(block.difficulty, block.timestamp, players)
                )
            );
    }
}
